import md5 from "md5";
import axios from "axios";
import React,{ useState,useEffect} from "react";

function App() {
const ts = Number(new Date());
const pv = '6a7d5ef012eee437a969ff58fa70c37f8b58bf8e';
const pub = 'eaa3e55abde93e3dc7c7b2b32fce2799';
const hash = md5(ts+pv+pub)

const [heroes,setHeroes] = useState([])
useEffect(()=>{
  axios.get(`http://gateway.marvel.com/v1/public/characters?ts=${ts}&apikey=${pub}&hash=${hash}`)
  .then(res=>{
    setHeroes(res.data.data.results)
    console.log(heroes)
  })
  .catch(error=>console.log(error))
},[])





  return (
    <div className="App">
       {
         heroes.map(heroe=>{
           return(
              <div>
                <img src={`${heroe}`}/>
                  <p>{heroe.name}</p>
                </div>
           )
         })
        }



    </div>
  );
}

export default App;
